-- ----------------------------
-- Table structure for `registro`
-- ----------------------------
DROP TABLE IF EXISTS `registro`;
CREATE TABLE `registro` (
`id_registro`  int(11) NOT NULL AUTO_INCREMENT ,
`idUsuario`  int(11) NULL DEFAULT NULL ,
`id_detins`  varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`lote`  varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`caducidad`  date NULL DEFAULT NULL ,
`fec_fab`  date NULL DEFAULT NULL ,
`id_fab`  int(11) NULL DEFAULT NULL ,
`id_sec`  int(11) NULL DEFAULT NULL ,
`id_ubi`  int(11) NULL DEFAULT NULL ,
`cant`  int(11) NULL DEFAULT NULL ,
`cant_caja`  int(11) NULL DEFAULT NULL ,
`tipo_mov`  varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`fec_hor`  datetime NULL DEFAULT NULL ,
PRIMARY KEY (`id_registro`),
FOREIGN KEY (`id_detins`) REFERENCES `det_insumo` (`id_detins`) ON DELETE CASCADE ON UPDATE CASCADE,
FOREIGN KEY (`idUsuario`) REFERENCES `usuarios` (`id_usu`) ON DELETE CASCADE ON UPDATE CASCADE,
INDEX `idUsuario` (`idUsuario`) USING BTREE ,
INDEX `id_detins` (`id_detins`) USING BTREE ,
INDEX `id_ubi` (`id_ubi`) USING BTREE 
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
AUTO_INCREMENT=20

;

